import React, { useState, useEffect } from "react";
import Name from './hooks/userName'
import { Outlet, } from 'react-router-dom'
// import UseTable from "./hooks/useTable";
import { useNavigate } from 'react-router-dom'
import FormNew from './formNew'
// import axios from 'axios'
import { useAuth } from './auth'

export const AddNewRecipe = () => {

    useEffect(() => {
        const auth = useAuth()
        const [user, setUser] = useState()
        var name = auth.user
        setUser(name)
        console.log(name)

    }, [])

    const navigate = useNavigate()
    return (
        <>
            <button className="btn btn-primary mt-2" variant="primary" onClick={() => navigate('/AddNewRecipe/WriteNew', { us: user })}>Write your on recipe</button>
            <button className="btn btn-primary mt-2" variant="primary" onClick={() => navigate('/AddNewRecipe/FindNew')}>Find for new recipes</button>
            <Outlet />



            <button className="btn btn-primary mt-2" variant="primary" onClick={() => navigate(-1)}>Go back</button>
        </>
    )
}
